//--UNP_khajiit_texture by Assidman--//

This is a simple retexture for Khajiit female body made for UNP mesh model. Made it for my personal Khajiit character and decided to share it with you. 

//--UNP BODY REQUIRED--//
http://skyrim.nexusmods.com/downloads/file.php?id=6709

//--INSTALL--//
Drag the \"Data\" folder inside de \".zip\" file on to your game installation and overwrite files if necessary.

//--UNINSTALL--//
Delete the following: 

Data\\textures\\actors\\character\\khajiitfemale\\femalebody.dds
Data\\textures\\actors\\character\\khajiitfemale\\femalebody_msn.dds
Data\\textures\\actors\\character\\khajiitfemale\\femalebody_s.dds

Because cats don\'t use clothes.
